import React, { Component } from 'react';
import './App.css';

class App extends Component {
  render() {
    const name = 'Daniel Andersson hej hej';
    const loading = false;

    return (
      <div className='App'>
        {loading ? <h4>Loading Data ...</h4> : <h1>Hello {name}</h1>}
      </div>
    );
  }
}
export default App;
